import React from "react";
import { Link } from "react-router-dom";

function Cart() {
  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold">Your Cart</h1>
      <p>Your selected items will appear here.</p>
      <Link to="/" className="text-blue-500">Back to Home</Link>
    </div>
  );
}

export default Cart;
